= dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.monotonic()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.monotonic()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.monotonic()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.monotonic()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.monotonic()\n            df2.head()\n            stop = time.monotonic()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.monotonic()\n            anom_mean.compute()\n            stop = time.monotonic()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"source":{"id":"1072"}},"id":"1104","type":"CDSView"},{"attributes":{"fill_color":{"field":"bandwidth","transform":{"id":"1147"}},"height":{"value":1},"line_color":{"field":"bandwidth","transform":{"id":"1147"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1167","type":"Rect"},{"attributes":{"below":[{"id":"1189"}],"center":[{"id":"1192"},{"id":"1195"}],"left":[{"id":"1193"}],"name":"bandwidth_type_histogram","renderers":[{"id":"1200"}],"sizing_mode":"stretch_both","title":{"id":"1179"},"toolbar":{"id":"1196"},"toolbar_location":null,"x_range":{"id":"1181"},"x_scale":{"id":"1185"},"y_range":{"id":"1183"},"y_scale":{"id":"1187"}},"id":"bk-bandwidth-type-plot","subtype":"Figure","type":"Plot"},{"attributes":{"months":[0,4,8]},"id":"1272","type":"MonthsTicker"},{"attributes":{},"id":"1276","type":"Selection"},{"attributes":{},"id":"1187","type":"CategoricalScale"},{"attributes":{},"id":"1288","type":"UnionRenderers"},{"attributes":{"color_mapper":{"id":"1147"},"formatter":{"id":"1172"},"label_standoff":12,"location":[0,0],"major_label_policy":{"id":"1257"},"ticker":{"id":"1173"}},"id":"1171","type":"ColorBar"},{"attributes":{"range_padding":0},"id":"1109","type":"DataRange1d"},{"attributes":{"active_multi":null,"tools":[{"id":"1090"},{"id":"1091"},{"id":"1092"},{"id":"1093"},{"id":"1105"}]},"id":"1095","type":"Toolbar"},{"attributes":{"formatter":{"id":"1230"},"major_label_policy":{"id":"1231"},"ticker":{"id":"1120"}},"id":"1119","type":"DatetimeAxis"},{"attributes":{},"id":"1076","type":"DataRange1d"},{"attributes":{"axis":{"id":"1162"},"dimension":1,"ticker":null},"id":"1164","type":"Grid"},{"attrib
